import React, { useState } from "react";

const Project = ({ id, screenshot, name, category }) => {
  return (
    <>
      <article>
        <p>{id}</p>
        <img src={screenshot} alt={name} />
      </article>
      <footer>
        <div className="project-info">
          <h4>{name}</h4>
          <h4>{category}</h4>
        </div>
      </footer>
    </>
  );
};

export default Project;
